class Solution {
  int minimumCost(String source, String target, List<String> original, List<String> changed, List<int> cost) {
    int n = source.length;
    List<int> dp = List.filled(n + 1, 1 << 30);
    dp[0] = 0;
    for (int i = 0; i < n; i++) {
      dp[i + 1] = min(dp[i + 1], dp[i]);
      for (int j = 0; j < original.length; j++) {
        if (i + original[j].length <= n) {
          String sub = source.substring(i, i + original[j].length);
          if (sub == original[j]) {
            for (int k = 0; k <= i; k++) {
              String tSub = target.substring(k, min(n, k + changed[j].length));
              if (tSub == changed[j] && dp[i] != 1 << 30) {
                dp[min(n, k + changed[j].length)] = min(dp[min(n, k + changed[j].length)], dp[i] + cost[j]);
              }
            }
          }
        }
      }
    }
    return dp[n] == 1 << 30 ? -1 : dp[n];
  }

  int min(int a, int b) => a < b ? a : b;
}
